    "description": "An address in one of Manhattan's most happening neighborhoods is the main attraction at the non-smoking Holiday Inn NYC - Lower East Side, which treats you to free Wi-Fi and morning newspapers.  There's a fun and funky vibe at the eight-story Holiday Inn. Bright splashes of color and lots of wood give the 132 non-smoking rooms and suites a modern feel. Flat-panel TVs, beds dressed in crisp linens and a choice of pillows make it easy to settle in. With free Wi-Fi connections and coffeemakers, the smartly designed work desks make great virtual offices. You can work out with the free weights and cardio equipment in the fitness room. Resembling an old-fashioned diner, the retro restaurant is all dolled up in cherry red. There's also an around-the-clock convenience store. Other perks include same-day dry cleaning, business services and free newspapers. Parking is available nearby for a fee. The Holiday Inn sits in the heart of the Lower East Side, a hip neighborhood full of hip boutiques and chic eateries. Within walking distance is the Lower East Side Tenement Museum, a look at life in the city for immigrant families. Also nearby are vibrant districts like Chinatown and Little Italy. LaGuardia Airport is a 19-minute drive northeast, Newark Liberty International Airport is 20-minute drive southwest, and Kennedy International Airport is a 30-minute drive southeast (all dependent on traffic conditions). All of Lower Manhattan is accessible from the Holiday Inn NYC - Lower East Side, which combines a near-it-all address with modern rooms and amenities like free Wi-Fi. ",
