    "description": "Located in the center of Manhattan, the non-smoking Hyatt Place New York Midtown South offers contemporary rooms with plenty of tech amenities, including free Wi-Fi. Rising 24 floors, the Hyatt Place gives you a great vantage point for views of New York City. Contemporary color schemes, smartly designed furnishings and wide windows make the 185 non-smoking rooms and suites stand out. Corner sofas mean you have plenty of lounging space, and pillowtop beds practically guarantee a good night's sleep. High-tech touches include free Wi-Fi connections and 42-inch flat-panel TVs that have plugs for laptops, well-lit work desks with ergonomic chairs and coffeemakers. The sleek bathrooms have granite countertops and are stocked with high-end products. Burn calories in the fitness room, and keep up with work in the business center. Concierge service is available, and there's a charge for valet parking.  The hotel is just a five-minute walk from the Empire State Building, making it a great base for exploring the city. The subway is minutes from the door, so getting around is a snap. World-class shopping at Macy's is just around the corner, Madison Square Garden is a 10-minute walk and about 13 minutes north is Times Square. Depending on traffic conditions, LaGuardia Airport is a 17-minute drive northeast, John F Kennedy International Airport is a 25-minute drive southeast and Newark Liberty International Airport is 26-minute southwest. With \"space to both work and relax,\" the \"excellent\" Hyatt Place New York Midtown South is a well-placed hotel for work and play. ",
