    "description": "From personal butlers to personal trainers, nothing is too extravagant at the Chatwal, a Luxury Collection Hotel, which also offers walking-distance proximity to Times Square, Radio City Music Hall and Broadway theaters. The 10-story hotel occupies a handsome Beaux Arts building with a  ground-floor restaurant and other public spaces featuring Art Deco style, with red-leather banquettes, terrazzo floors and gleaming chrome lighting fixtures. The on-site spa has three treatment rooms as well as a lap pool that simulates ocean currents and a fitness room with personal-training services. Every inch of each of the 76 rooms is carefully designed, from the attaché-case nightstands to the steamer-trunk vanities. High-tech gadgetry includes 42-inch flat-panel TVs, connections for mp3 players and free wired and wireless internet access. Custom-designed beds are covered with 400-thread-count linens and down comforters, and bathrooms feature rainfall showers and his-and-hers bath products. Valet parking is available for a fee, and pets are welcome for a fee.  The Chatwal is a half a block from Times Square in the heart of the Theater District. Radio City Music Hall and Rockefeller Center are six blocks away. At least 15 subway lines are accessible within a few blocks. LaGuardia Airport is nine miles, JFK is 17 miles and Newark's airport is 16 miles away. Unexpected perks, beautiful design and loads of upscale style provide the kind of excitement Priceline guests appreciate at The Chatwal, a Luxury Collection Hotel. ",
