    "description": "Spacious rooms with plush-top beds and flat-panel HDTVs, with Rockefeller Center three blocks away, provide a great Gotham getaway for Priceline guests at Doubletree by Hilton Metropolitan Hotel. Designed by the renowned Morris Lapidus in 1959, the 20-floor Metropolitan has a retro modernist exterior shaped like a perpendicular blue wave. The hotel has a fun history: the famous scene in \"The Seven Year Itch\" where a subway vent blows Marilyn Monroe's skirt up was filmed in front of the hotel. The 759 contemporary rooms have granite countertops, flat-panel HDTVs, Wi-Fi (surcharge) and signature Doubletree beds with custom-designed mattresses, baffle-box, down blankets, and high-thread-count cotton linens with triple sheeting. Property amenities include a restaurant, a lounge, a fitness center and concierge service. Valet parking is available for an additional fee. The Doubletree is at Lexington and 51st Street in Midtown Manhattan. LaGuardia Airport is eight miles, JFK is 16 miles, and Newark Airport is 15 miles from the hotel. All of the Big Apple, and we mean all of it, can be viewed from the Top of the Rock at Rockefeller Center, three blocks west. Radio City Music Hall is four blocks, and the Theatre District is five blocks west. It's a short stroll east to the East River and the United Nations. A subway stop is next to the hotel.  Priceline guests call this a great place to sleep in The City That Never Sleeps, with a \"great view,\" \"clean, spacious rooms,\" \"warm, friendly staff\" and a location near Rock Center and the subway.  ",
