    "description": "A renovated 1927 beauty with specially crafted beds and flat-screen TVs in upscale rooms, The Benjamin lavishes Priceline guests with fine service and a non-smoking Midtown location near Fifth Avenue shopping. Meticulously restored to its 1927 Jazz Era splendor, The Benjamin offers 209 luxurious and rooms and suites on 29 floors. The hotel takes great pride in its signature Benjamin Bed, with specially engineered features, and made up with 100 percent Egyptian-cotton, 400-thread-count sheets and down-filled comforters. Rooms also have flat-screen TVs and kitchen facilities. Wi-Fi is available for a fee in rooms and is free in public spaces. The hotel serves modern bistro cuisine in its exquisite dining room, with an antique mirror light fixture, bronze spiral staircase, distressed peacock-blue leather banquettes, classic marble table tops, and geometric black-and-white, glazed-tile flooring. Room service is also an option. Book a spa treatment, get work done in the business center or squeeze in a workout in the 24-hour fitness room. Pets are welcome, and valet parking is available, both for an extra charge Located on the corner of East 50th Street and Lexington in Midtown East, The Benjamin is a block from the subway. Grand Central Terminal is only a few blocks away. If you're driving to the hotel, LaGuardia Airport is a 20-minute drive, JFK is 30 minutes, and Newark is 30 minutes away (all times dependent on traffic conditions). Parking is available (fee). The Benjamin is within walking distance of Times Square, Broadway theaters, Macy's, Rockefeller Center, and Fifth Avenue boutiques. Priceline guests love the serious pampering at this throwback to the elegant days of yesteryear, where plush beds, sterling service, and retro interiors are just the beginning of a wonderful stay. ",
