    "description": "With complimentary internet access, coffee service and morning newspapers, the non-smoking Courtyard by Marriott New York Manhattan/Times Square West also offers well-equipped rooms and a high-tech lobby area.  Brilliant strips of red and orange distinguish the facade at the Courtyard by Marriott, a 27-story tower that opened in 2013. Done up in soothing neutral tones with bright pops of color, the 224 non-smoking rooms and suites have flat-panel TVs with pay-per-view movies, well-lit work desks and coffeemakers. Free Wi-Fi keeps you connected to friends and family. You can work out with the free weighs and cardio machines in the fitness room. The restaurant serves breakfast and dinner. Enjoy free coffee and newspapers in the lobby, which also has a kiosk where you can print out airport boarding passes, media pods for business meetings and an interactive video screen where you can catch up on the news. Same-day dry cleaning and laundry service is available. Parking is available nearby. Located off Eighth Avenue, the Courtyard by Marriott puts you five blocks south of 42nd Street. Dozens of Broadway and off-Broadway theaters are within a 10-minute of the hotel. About three blocks east is the Jacob K. Javits Convention Center. Less than 15 minutes away is leafy Bryant Park and the iconic New York Public Library. LaGuardia Airport is a 21-minute drive northeast, Newark Liberty International Airport is 25-minute southwest and Kennedy International Airport is a 30-minute drive southeast (all dependent on traffic conditions). Bring your walking shoes, as the Courtyard by Marriott New York Manhattan/Times Square West lets you stroll to a Broadway theater or the shops around Times Square. Free internet access is also a plus in the contemporary rooms.  ",
