    "description": "Impeccable Japanese comfort, downy beds, terrific views, marble baths and plasma TVs make The Kitano New York a winner with Priceline guests. The 18-story Kitano offers 149 lavish guestrooms with custom-designed mahogany accents, original Japanese floral art, and cherry furnishings. Down comforters and pillows sit atop pillowtop mattresses. Soundproofed windows open to the sights and sounds of the city, but close for a silent sleep. Rooms also have plasma TVs with HBO channels, plus Wi-Fi service (surcharge) and large desks. Marble bathrooms create a spa-like feeling with towel warmers and premium toiletries. The hotel bar and lounge features talented jazz musicians five nights a week. Hotel guests and local patrons alike appreciate the in-house traditional Japanese restaurant, which includes private tatami rooms. The café in an adjacent townhouse offers Japanese-American choices for breakfast, lunch and dinner. Parking is available for a fee. The Kitano is seven blocks from the Empire State Building and four blocks from Grand Central Terminal. If you're driving to the hotel, LaGuardia Airport is a 20-minute drive, JFK is 30 minutes, and Newark's airport is 30 minutes away (all times dependent on traffic conditions).  When Priceline guests say \"sayonara\" to the Japanese-inspired Kitano New York, they miss its sumptuous rooms, stellar views, fine service, and great location near Grand Central and the Empire State.  ",
