    "description": "Forget about taxis, as many of the city's most desirable destinations are walking distance from the non-smoking Fairfield Inn & Suites New York Midtown Manhattan/Penn Station. Perks here include a rooftop bar and lounge, a fitness center and extras like a free continental breakfast and internet access. Built in 2013, the 23-story Fairfield Inn & Suites has an ultramodern glass-and-steel facade that ensures that you're always checking out the view. The 225 rooms and suites are done up in contemporary shades of lime and plum and have lots of light streaming through the wide windows. Look for 37-inch LCD TVs with premium movie channels, beds covered with crisp linens and coffee and tea service. Work desks with ergonomic chairs and safes big enough for laptops emphasize that this hotel means business. Free wired and wireless internet access is another plus. After working out in the fitness room, reward yourself with a trip to the rooftop bar and lounge overlooking the city skyline. Complimentary coffee is available in the lobby for whenever you need a jolt, and a free continental breakfast is served every morning. Same-day dry cleaning and laundry service keep you looking spiffy. Parking is available. If you're catching the big game at Madison Square Garden, you'd be hard-pressed to find a hotel closer than the Fairfield Inn & Suites. Also less than one block away is Penn Station, the city's main train station. If you're in the mood for shopping, Macy's is two blocks away. A 15-minute walk from the front door takes you to the Empire State Building. Depending on traffic, LaGuardia Airport is a 22-minute drive northeast, Newark Liberty International Airport is 24-minute southwest, and Kennedy International Airport is a 31-minute drive southeast. An amazing address puts you close to the sights at the Fairfield Inn & Suites New York Midtown Manhattan/Penn Station, where you'll be treated to free internet access and breakfast buffets. ",
