    "description": "Free Wi-Fi, on-site dining with room service and a location a few blocks from Grand Central Terminal make the non-smoking Bernic Hotel a convenient choice in Midtown East. The non-smoking, high-rise Bernic Hotel welcomes guests to a stylish lobby featuring colorful art. Posh rooms, some with private balconies, feature 43-inch Apple TVs, free Wi-Fi and coffeemakers, and the tiled bathrooms boast heated floors and rainfall showers. Floor-to-ceiling windows add brightness. Wrap up in the provided bathrobe and indulge in room service, or head down to meet friends at the bar and restaurant. The 24-hour front desk for help with copy and fax services anytime. Pet-friendly rooms and valet parking are available, both for a charge. The Bernic is a five-minute walk from Grand Central Terminal in Manhattan's Midtown East neighborhood. It's surrounded by restaurants and shops four blocks from the nearest subway. Walk 20 minutes to the Theater District and Times Square or up to Central Park. Other points of interest include Madison Square Garden and Penn Station, a mile-and-a-half by cab. The hotel is four miles from the Bull on Wall Street and Ground Zero. LaGuardia Airport is 11 miles away, and John F. Kennedy International Airport is 16 miles. The Bernic Hotel is within easy walking distance of the subway and many sights, and Priceline guests make special note of the attentive staff and tasty hotel restaurant. ",
