    "description": "Arlo NoMad is 2113 feet from Madison Square Park, 1056 feet from the Empire State Building and 2641 feet from Herald Square. The access to the Subway Train 6, on 33rd Street and Park Avenue, is 1056 feet from the property. Each room at the hotel is sized at 150 square feet and is fitted with a refrigerator, flat-screen cable TV, work desk and complimentary WiFi. The business center is available for guests’ use for free. Cleaning, ironing and laundry services can be availed for an additional fee. Arlo NoMad also has a 24-hour front desk and a 24-hour onsite market with snacks curated by Mouth NYC and specialty gifts from Exit9. The rooftop bar, Arlo Rooftop, offers views of downtown and uptown Manhattan. Guests can also enjoy a meal at the on-site restaurant, Lamalo. The menu at Lamalo draws from the diverse and flavorful cuisine of the Middle East, specifically Israel, by offering an authentic taste of the region with a few nods to New York. The menu is designed for sharing and will feature a variety of Middle Eastern dips that fill the table minutes after guests are seated. The appetizers will change seasonally and always be accompanied by the house-made Jerusalem Laffa. Another bar, BARlo, can be found on the second floor. John F. Kennedy International Airport is 16 mi away while Newark Airport is 17 mi from the property. At Arlo NoMad, guests will also have several shopping destinations, bars and eateries within close proximity. Shake Shack is 2113 feet away. ",
