    "description": "Free Wi-Fi, free Continental breakfast, and a Greenwich Village location, make the smoke-free Washington Square Hotel a charming choice for our guests across the street from the vibrant Washington Square Park.  The Washington Square Hotel, with 150 guestrooms on nine floors, has hosted many illustrious artists and writers over its 100-year history. Now updated, each Art Deco-styled guestroom features a pillowtop mattress covered by a soft duvet, plus an LCD TV, cable channels, free Wi-Fi, an in-room safe, and a generous bathroom. Get a workout in the fitness room or take a scenic jog around Washington Square Park. The Parisian-inspired lobby bar hosts an Afternoon Tea. After a long day on the city streets, relax in the lounge with your favorite cocktail or a glass of wine. The critically acclaimed on-site restaurant serves breakfast, lunch, dinner, and brunch on the weekends. The staff provides concierge service.    The hotel is located at 103 Waverly Place near historic Washington Square. If you're driving to the hotel, LaGuardia Airport is a 20-minute drive, JFK is 30 minutes, and Newark is 30 minutes away (all times dependent on traffic conditions). Parking is available (fee). Greenwich Village has been described as the soul of downtown lower Manhattan, alive with tasteful restaurants, hip clubs, and unique shops.  An utterly romantic stay awaits our guests at this intimate hotel in the neighborhood of folkies and poets, right near Washington Square Park.  ",
